function About_Page() {

  return (
    <React.Fragment>
      {/* <!-- Main Content of the Webpage --> */}
      {/* <!-- Items that will not be displayed with all width of the Page --> */}
      <div className="container-md">
          <br></br>
        <h2>Store of Cars Parts</h2>
        <hr className="break-line"></hr>
        <div className="row">
        <div className="col-9">
            
        </div>
        </div>
      </div>
    </React.Fragment>
  )

}

export default About_Page;
